import base64
import simpleaudio as sa

# Base64-encoded WAV audio (replace with your actual base64 string)
b64_audio = """

"""

# Decode and write to WAV file
with open('decoded_audio.wav', 'wb') as f:
    f.write(base64.b64decode(b64_audio))

# Load and play audio
try:
    wave_obj = sa.WaveObject.from_wave_file("decoded_audio.wav")
    play_obj = wave_obj.play()
    play_obj.wait_done()  # Wait until playback finishes
except Exception as e:
    print("Failed to play audio:", e)
